import './App.css';
import Sidebar from './Components/sidebar';
import { BrowserRouter, Router, Route, Routes, Switchs} from 'react-router-dom';
import Home from './Pages/Home';

function App() {
  return (
    <Router>

      <div className="App">
        <Sidebar />
        <div className="Content">
          <Switch>
            <Route path="/home" element={<Home />} />
          </Switch>
        </div>
      </div>
    </Router>
  );
}

export default App;
